syntax = "proto3";
package fanxi;
import "RestfulBaseResponse.proto";
option java_package = "com.fanxi.service.message";
option java_outer_classname = "QuayResponseProto";

message QuayResponse {
   RestfulBaseResponse baseResponse=1;
   int32 wonCashXu=5;
   int64 cashXu=6;
   int32 typeXu=7;
   int32 wonCashGold=8;
   int64 cashGold=9;
   int32 typeGold=10;
   int32 timesQuay=11;
   
}




